                  <td>{user.firstname}</td>
                  <td>{user.lastname}</td>
                  <td>{user.sex}</td>
                  <td>{user.age}</td>
                </tr>
              );
            })} 
          </tbody>  */}
        </table>
        {/* <Link to="/users" className="btn btn-primary" > */}
          {/* Create New User */}
        {/* </Link> */}
      </div>
    );
  }
}

const mapStateToProps = (state) => {
  return {
    users: state.getUsers.users
  }
};

export default connect(mapStateToProps, mapDispatchToProps)(UserList);
